import React, { Fragment } from "react";

import Counter from "./componants/Counter";
import Navigation from "./componants/Navigation";
import LoginForm from "./componants/LoginForm";

function App() {
  return (
    <Fragment>
      <LoginForm />
      <Navigation />
      <Counter />
    </Fragment>
  );
}

export default App;
